import { Avatar, Grid } from '@mui/material';
import React, { Component } from 'react';
import './Navbar.css'
import insta_logo from '../../images/logoinsta.png'
import homelogo from '../../images/home.svg'
import msglogo from '../../images/message.svg'
import uploadlogo from '../../images/upload.png'
import findlogo from '../../images/find.svg'
import reactlogo from '../../images/home.svg'
import people4 from '../../images/pp4.jpeg'
class Navbar extends Component {
    constructor(props) {
        super(props);
    }
    state = {  }
    render() { 
        return ( 
            <div>
                <div className='navbar_content'>
                    <Grid container>
                        <Grid item xs={2}></Grid>
                        <Grid item xs={3}>
                            <div className='insta_logo'>
                                <img src={insta_logo} width="125px"/>
                            </div>
                        </Grid>
                        <Grid item xs={3}>
                            <input className='searchbar' type="text" placeholder="Search" />
                        </Grid>
                        <Grid item xs={3} style={{"display":"flex","margin-left":"-30px"}}>
                            <img className='navbar_logos' src={homelogo} placeholder="home" width="25px"/>
                            <img className='navbar_logos' src={msglogo} placeholder="message" width="25px"/>
                            <img className='navbar_logos' src={uploadlogo} placeholder="home" width="25px"/>
                            <img className='navbar_logos' src={findlogo} placeholder="home" width="25px"/>
                            <img className='navbar_logos' src={reactlogo} placeholder="home" width="25px"/>
                            <Avatar className='navbar_avatar' src={people4} style={{"maxWidth":"30px","maxHeight":"30px"}}/>
                            
                        </Grid>
                        <Grid item xs={1}></Grid>
                    </Grid>
                </div>
            </div>
         );
    }
}
 
export default Navbar;
